import React ,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar, NavbarBrand, NavbarToggler,NavItem, Dropdown, DropdownToggle, DropdownMenu, DropdownItem ,Button} from 'reactstrap';
import {useHistory, NavLink, Redirect} from 'react-router-dom';
import './navi.css';
import {connect} from 'react-redux';


class Navi extends Component
{
    constructor(props){
                super(props);
                const token = localStorage.getItem("token")
                let loggedIn = true
                if(token ==  null)
                {
                    loggedIn=false
                }

                this.state={
                    loggedIn
                }
        }

    render() {

        if(this.state.loggedIn === true)
        {
            return(
            <NavItem>
                <NavLink className="nav-link" to='/'><span
                    className="fa fa-sign-out fa-lg"></span> Log Out
                </NavLink>
            </NavItem>)
        }
    // const {isAuthenticated} = this.props;
    //
    // Navi.propTypes = {
    //     isAuthenticated: React.PropTypes.bool,
    //
    // }


    const guestLinks =(
        <Nav navbar className="ml-auto">
        <NavItem>
            <NavLink className="nav-link" to='/home'><span
                className="fa fa-user fa-lg"></span>Login</NavLink>
        </NavItem>
        </Nav>
    );

    return (
        <div>
            <Navbar className="fixed-top" dark expand="md">
                <div className="container-fluid">
                    <NavbarToggler/>
                    <NavbarBrand className="mr-auto" href="/"><h3>Wallet as a Service</h3></NavbarBrand>
                    <Nav navbar className="ml-auto">
                        <NavItem>
                            <NavLink className="nav-link" to='/home'><span
                                className="fa fa-home fa-lg"></span> Home</NavLink>
                        </NavItem>


                            <NavItem>
                                <NavLink className="nav-link" to='/'><span
                                    className="fa fa-sign-out fa-lg"></span> Log In
                                </NavLink>
                            </NavItem>

                    </Nav>

                </div>
            </Navbar>

        </div>
    );
}
}



